function Carousel(){

    var carImages=[
        {
            src: require("../Images/rivulet.jpg"),
            alt: "Image1",
        },
        {
            src: require("../Images/structure.png"),
            alt: "Image2",
        },
        {
            src: require("../Images/fastboy.jpg"),
            alt: "Image3",
        },
    ]

    return (
        <div id="carousel" className="relative max-w-screen max-h-[20vh]">
            {carImages.map((img, index) => {
                return(<img className="w-20" src={img.src} alt={img.alt} key={index}></img>)
            })}
        </div>
    )
}

export default Carousel
